import {Table } from 'react-bootstrap';
import {rows} from './rows'
const app =() =>{
return(    
    <Table striped bordered hover>
    <thead>
      <tr>
        <th>#</th>
        <th>First Name</th>
        <th>Last Name</th>
        <th>Username</th>
      </tr>
    </thead>
    <rows/>
  </Table>
        
     
    );
}

export default app;
